description:
Jeremiah Harm Vol. 1

Genre: Science Fiction

English | CBR | 5 Issues

Written by Keith Giffen and Alan Grant
Art by Rafael Albuquerque and Rael Lyra

When three of the galaxy's most fearsome criminals escape confinement on a prison planet and wind up on Earth, the authorities have no choice but to free the most wanted man in the universe, Jeremiah Harm, to track these fugitives down and stop them. He doesn't love you, he doesn't want to be your friend, he isn't your super-hero and God help you if you find yourself in harm's way!

